script: |
  super -f text -I q4926.spq | sort > q4926.out

inputs:
  - name: q4926.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE col2 + - col1 * - col0 + + ( + ( + 91 ) ) + + col0 BETWEEN + - col0 AND - + 83 * + col2 * + col0 + - + col2 * - col1 * + col1;
  - name: tab2

outputs:
  - name: q4926.out
    data: |
      64	77	40
